import React from "react";
import Slider from "react-slick";
import "./css/carousel.css"; // Per personalitzar estils

function VideoCarousel() {
    const videos = [
        {
            id: 1,
            title: "Wisconsin",
            videoUrl: "https://drive.google.com/file/d/1MF9pskvYNstpLSs_vHGEpdLKcZDiAxYS/preview",
        },
        
    ];

    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
    };

    return (
        <div className="carousel-container">
            <h2>Google Drive Video Carousel</h2>
            <Slider {...settings}>
                {videos.map((video) => (
                    <div key={video.id} className="carousel-item">
                        <iframe
                            src={video.iframeUrl}
                            allow="autoplay; encrypted-media"
                            title={video.title}
                            className="carousel-iframe"
                            frameBorder="0"
                        ></iframe>
                        <h3 className="carousel-title">{video.title}</h3>
                    </div>
                ))}
            </Slider>
        </div>
    );
}

export default DriveVideoCarousel;
